script: |
  super -f text -I q3304.spq | sort > q3304.out

inputs:
  - name: q3304.spq
    data: |
      SELECT ALL + 63 AS col1 FROM tab1 (FORMAT parquet) WHERE NOT - col0 NOT IN ( - 29 / + + col2 + + + col1, + col1, - 66 * 1 + - col2 + - 16, + col0 );
  - name: tab1

outputs:
  - name: q3304.out
    data: |
